    // The original regex failed because the `data` array is followed by "form:", not "uses:".
    // This updated regex correctly identifies the end of the data array in the provided structure.
    const dataRegex = /data:\s*(\[[\s\S]*?\]),\s*form:/; // <-- THE FIX IS HERE

